int map4[25][25] = {0};

void print_all(void)
{
    for (int i = 0; i < 25; ++i)
    {
        for (int j = 0; j < 25; ++j)
        {
            printf("%d ", map1[i][j]);
        }
        for (int j = 0; j < 25; ++j)
        {
            printf("%d ", map2[i][j]);
        }
        printf("\n");
    }
    for (int i = 0; i < 25; ++i)
    {
        for (int j = 0; j < 25; ++j)
        {
            printf("%d ", map3[i][j]);
        }
        for (int j = 0; j < 25; ++j)
        {
            printf("%d ", map4[i][j]);
        }
        printf("\n");
    }
}

int local_map(int x, int y)
{
    int rc;
    scanf("%d", &rc);
    if (rc == 1)
    {
        if (x * y < 0)//local_map[x][robot_pos[1]] = 2;
        {
            if (x < 0)
            {
                int i = abs(x)%24;
                int j = y%24;
                printf("1check1 %d %d\n", i, j);
                map1[i][j] = rc;
            }
            else
            {
                int i = x%24;
                int j = abs(y)%24;
                printf("3check3 %d %d\n", i, j);
                map3[i][j] = rc;
            }
        }
        else
        {
            if (x < 0)
            {
                int i = abs(x)%24;
                int j = abs(y)%24;
                printf("2check2 %d %d\n", i, j);
                map2[i][j] = rc;
            }
            else
            {
                int i = x%24;
                int j = y%24;
                printf("4check4\n %d %d", i, j);
                map4[i][j] = rc;
            }
        }
    }
    printf("%d %d\n", x, y);
    return rc;
}
